insert  into `eshop_about`(`id`,`is_del`,`create_time`,`update_time`,`about_title`,`about_content`,`about_index`) values ('1',2,'2018-05-23','2018-05-23','企业简介','<h2 class=\"page-heading\">\n                    <span class=\"page-heading-title2\">关于我们</span>\n                </h2>\n                <div class=\"content-text clearfix\">\n                    <p>明博科技注册于武汉东湖高新技术开发区，团队成员分布于武汉、北京、上海及南京。公司专注于互联网教育平台的开发运营及移动互联网应用的设计开发。</p>\n                    <p>公司团队以敏捷活跃的90后新人类为主力军，以经验丰富的70后为支撑，实现公司多层次、梯队化人才结构的融合成长。</p>\n                    <p>明博科技的企业客户将覆盖信息技术相关领域的企业及培训机构，同时我们还为其他行业的客户提供信息技术的相关服务及支持。</p>\n                    <p>明博科技的主要业务包括移动应用的设计及开发、基于beacon的软硬件的设计及开发、在线教育平台的设计、开发及运营。目前公司已经开发了轻实训平台、知名汽车企业的CRM系统。 </p>\n                    <p>高效为企业培养合适、合格、优质人才，建立企业后备人才梯队，降低企业人力资源总成本</p>\n                    <p>联合机构提供O2O培训服务，提高学习的知识留存率，降低学员学习总成本，为学员提供终生学习服务</p>\n                </div>',1),('2',2,'2018-05-23','2018-05-23','企业文化','<h2 class=\"page-heading\">\n                    <span class=\"page-heading-title2\">企业文化</span>\n                </h2>\n                <div class=\"content-text clearfix\">\n                    <p>明博科技注册于武汉东湖高新技术开发区，团队成员分布于武汉、北京、上海及南京。公司专注于互联网教育平台的开发运营及移动互联网应用的设计开发。</p>\n                    <p>公司团队以敏捷活跃的90后新人类为主力军，以经验丰富的70后为支撑，实现公司多层次、梯队化人才结构的融合成长。</p>\n                    <p>明博科技的企业客户将覆盖信息技术相关领域的企业及培训机构，同时我们还为其他行业的客户提供信息技术的相关服务及支持。</p>\n                    <p>明博科技的主要业务包括移动应用的设计及开发、基于beacon的软硬件的设计及开发、在线教育平台的设计、开发及运营。目前公司已经开发了轻实训平台、知名汽车企业的CRM系统。 </p>\n                    <p>高效为企业培养合适、合格、优质人才，建立企业后备人才梯队，降低企业人力资源总成本</p>\n                    <p>联合机构提供O2O培训服务，提高学习的知识留存率，降低学员学习总成本，为学员提供终生学习服务</p>\n                </div>',2),('3',2,'2018-05-23','2018-05-23','大事记','<h2 class=\"page-heading\">\n                    <span class=\"page-heading-title2\">大事件</span>\n                </h2>\n                <div class=\"content-text clearfix\">\n                    <p>明博科技注册于武汉东湖高新技术开发区，团队成员分布于武汉、北京、上海及南京。公司专注于互联网教育平台的开发运营及移动互联网应用的设计开发。</p>\n                    <p>公