/*Table structure for table `eshop_address` */

CREATE TABLE `eshop_address` (
  `id` varchar(200) NOT NULL COMMENT 'ID',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `user_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '所属用户 FK',
  `state_id` varchar(200) DEFAULT NULL COMMENT '国家 FK',
  `province_id` varchar(200) DEFAULT NULL COMMENT '省份 FK',
  `city_id` varchar(200) DEFAULT NULL COMMENT '城市 FK',
  `town_id` varchar(200) DEFAULT NULL COMMENT '区县 FK',
  `address_location` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '地址',
  `address_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '手机号或是固定电话号',
  `address_postcode` int(11) DEFAULT NULL COMMENT '邮政编码',
  `address_faddr_axes` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '传真',
  `address_is_def` int(11) DEFAULT NULL COMMENT '是否是默认地址1.是2.不是',
  `address_name` varchar(200) DEFAULT NULL COMMENT '地址别名',
  `address_recipients` varchar(200) DEFAULT NULL COMMENT '地址收件人',
  PRIMARY KEY (`id`),
  KEY `FK_Relationship_1` (`user_id`),
  KEY `state_id` (`state_id`),
  KEY `province_id` (`province_id`),
  KEY `city_id` (`city_id`),
  KEY `town_id` (`town_id`),
  CONSTRAINT `FK_Relationship_1` FOREIGN KEY (`user_id`) REFERENCES `eshop_user` (`id`),
  CONSTRAINT `eshop_address_ibfk_1` FOREIGN KEY (`state_id`) REFERENCES `eshop_address_state` (`id`),
  CONSTRAINT `eshop_address_ibfk_2` FOREIGN KEY (`province_id`) REFERENCES `eshop_address_province` (`id`),
  CONSTRAINT `eshop_address_ibfk_3` FOREIGN KEY (`city_id`) REFERENCES `eshop_address_city` (`id`),
  CONSTRAINT `eshop_address_ibfk_4` FOREIGN KEY (`town_id`) REFERENCES `eshop_address_town` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='收货地址/配送信息';

