/*Table structure for table `eshop_order` */

CREATE TABLE `eshop_order` (
  `id` varchar(200) NOT NULL COMMENT 'ID或订单号',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `user_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '所属用户 FK,购买用户',
  `address_id` varchar(200) DEFAULT NULL COMMENT '配送地址 FK',
  `order_deliver_fee` float(4,2) DEFAULT NULL COMMENT '运费',
  `order_total_fee` float(8,2) DEFAULT NULL COMMENT '应付金额',
  `order_price` float(8,2) DEFAULT NULL COMMENT '订单金额',
  `order_payment_way` int(11) DEFAULT NULL COMMENT '配送方式 1.自取,2.送货上门',
  `order_payment_cash` int(11) DEFAULT NULL COMMENT '货到付款方式.1现金,2信用卡',
  `order_is_paiy` int(11) DEFAULT NULL COMMENT '支付状态 :1到付,2待付款,3已付款,4待退款,5退款成功,6退款失败',
  `order_state` int(11) DEFAULT NULL COMMENT '订单状态 1:提交订单 2:仓库配货 3:商品出库 4:等待收货 5:完成 6待退货 7已退货',
  `order_recipients` varchar(200) DEFAULT NULL COMMENT '收件人',
  PRIMARY KEY (`id`),
  KEY `FK_Relationship_2` (`user_id`),
  KEY `address_id` (`address_id`),
  CONSTRAINT `FK_Relationship_2` FOREIGN KEY (`user_id`) REFERENCES `eshop_user` (`id`),
  CONSTRAINT `eshop_order_ibfk_1` FOREIGN KEY (`address_id`) REFERENCES `eshop_address` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单';

