/*Table structure for table `eshop_order_item` */

CREATE TABLE `eshop_order_item` (
  `id` varchar(200) NOT NULL COMMENT 'ID',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `order_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '所属订单 FK',
  `color_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '颜色 FK',
  `size_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '尺码 FK',
  `order_item_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品名称',
  `order_item_proice` decimal(6,2) DEFAULT NULL COMMENT '商品售价',
  `order_item_amount` int(11) DEFAULT NULL COMMENT '购买数量',
  `order_item_url` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品图片',
  `product_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '商品编码 FK',
  PRIMARY KEY (`id`),
  KEY `order_id` (`order_id`),
  KEY `color_id` (`color_id`),
  KEY `size_id` (`size_id`),
  KEY `eshop_order_item_ibfk_4` (`product_id`),
  CONSTRAINT `eshop_order_item_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `eshop_order` (`id`),
  CONSTRAINT `eshop_order_item_ibfk_2` FOREIGN KEY (`color_id`) REFERENCES `eshop_color` (`id`),
  CONSTRAINT `eshop_order_item_ibfk_3` FOREIGN KEY (`size_id`) REFERENCES `eshop_size` (`id`),
  CONSTRAINT `eshop_order_item_ibfk_4` FOREIGN KEY (`product_id`) REFERENCES `eshop_product` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单详情';

