/*Table structure for table `eshop_product` */

CREATE TABLE `eshop_product` (
  `id` varchar(200) NOT NULL COMMENT 'ID',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `create_time` date DEFAULT NULL COMMENT '添加时间',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `brand_id` varchar(200) DEFAULT NULL COMMENT '品牌ID FK',
  `type_id` varchar(200) DEFAULT NULL COMMENT '类型ID FK',
  `product_name` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `product_weight` varchar(20) DEFAULT NULL COMMENT '商品重量',
  `product_is_new` int(11) DEFAULT NULL COMMENT '是否新品特惠:1-旧品,2-新品',
  `product_is_hot` int(11) DEFAULT NULL COMMENT '是否畅销:1-不畅销,2-畅销',
  `product_is_commend` int(11) DEFAULT NULL COMMENT '是否推荐:1-不推荐,2-推荐',
  `product_is_show` int(11) DEFAULT NULL COMMENT '上架/下架:1-下架,2-上架',
  `product_sales` int(11) DEFAULT NULL COMMENT '销售量',
  `product_description` text COMMENT '商品描述',
  `product_information` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '商品详情',
  `product_after_sale` text COMMENT '商品售后保障',
  `product_colors` varchar(200) DEFAULT NULL COMMENT '商品颜色集',
  `product_sizes` varchar(200) DEFAULT NULL COMMENT '商品尺寸集',
  `product_features` varchar(200) DEFAULT NULL COMMENT '属性集',
  `check_user_id` varchar(200) DEFAULT NULL COMMENT '审核人ID FK',
  `product_check_time` date DEFAULT NULL COMMENT '审核时间',
  PRIMARY KEY (`id`),
  KEY `FK_Relationship_16` (`type_id`),
  KEY `FK_Relationship_4` (`brand_id`),
  KEY `FK_Relationship_20` (`check_user_id`),
  CONSTRAINT `FK_Relationship_20` FOREIGN KEY (`check_user_id`) REFERENCES `eshop_user` (`id`),
  CONSTRAINT `FK_Relationship_4` FOREIGN KEY (`brand_id`) REFERENCES `eshop_brand` (`id`),
  CONSTRAINT `fk_type` FOREIGN KEY (`type_id`) REFERENCES `eshop_type` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品';

