/*Table structure for table `eshop_resource` */

CREATE TABLE `eshop_resource` (
  `id` varchar(200) NOT NULL COMMENT 'ID',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `resource_name` varchar(20) DEFAULT NULL COMMENT '名称',
  `resource_parent_id` varchar(200) DEFAULT NULL COMMENT '父ID',
  `resource_url` varchar(200) DEFAULT NULL COMMENT '跳转的链接',
  `resource_ico` varchar(200) DEFAULT NULL COMMENT '图标',
  `resource_index` int(11) DEFAULT NULL COMMENT '顺序',
  `resource_description` varchar(200) DEFAULT NULL COMMENT '描述',
  `resource_image` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='资源';

/*Data for the table `eshop_resource` */

