/*Table structure for table `eshop_sku` */

CREATE TABLE `eshop_sku` (
  `id` varchar(200) NOT NULL COMMENT 'ID',
  `is_del` int(11) DEFAULT NULL COMMENT '是否已经删除:1-已删,2.未删',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `update_time` date DEFAULT NULL COMMENT '更新时间',
  `product_id` varchar(200) DEFAULT NULL COMMENT '产品FK ID',
  `color_id` varchar(200) DEFAULT NULL COMMENT '颜色FK ID',
  `size_id` varchar(20) DEFAULT NULL COMMENT '尺码FK ID',
  `sku_delive_fee` float(4,2) DEFAULT NULL COMMENT '运费:默认10元',
  `sku_price` float(8,2) DEFAULT NULL COMMENT '售价',
  `sku_stock` int(11) DEFAULT NULL COMMENT '库存',
  `sku_market_price` float(8,2) DEFAULT NULL COMMENT '市场价',
  `sku_sales` int(11) DEFAULT NULL COMMENT '销量',
  `sku_upper_limit` int(20) DEFAULT NULL COMMENT '购买限制',
  `sku_location` varchar(200) DEFAULT NULL COMMENT '货架号',
  `sku_img` varchar(200) DEFAULT NULL COMMENT '图片',
  `sku_index` int(11) DEFAULT NULL COMMENT '前台显示排序',
  `sku_name` varchar(100) DEFAULT NULL COMMENT '名称',
  `create_user_id` varchar(200) DEFAULT NULL COMMENT '创建用户FK ID',
  `update_user_id` varchar(200) DEFAULT NULL COMMENT '更新用户FK ID',
  `sku_status` int(20) DEFAULT NULL COMMENT '状态:1-历史,2-最新',
  `sku_type` int(20) DEFAULT NULL COMMENT '类型:1-赠品,2-普通',
  `sku_rank` float DEFAULT NULL COMMENT '打星',
  PRIMARY KEY (`id`),
  KEY `FK_Relationship_7` (`product_id`),
  KEY `size_id` (`size_id`),
  KEY `color_id` (`color_id`),
  CONSTRAINT `FK_Relationship_7` FOREIGN KEY (`product_id`) REFERENCES `eshop_product` (`id`),
  CONSTRAINT `eshop_sku_ibfk_1` FOREIGN KEY (`size_id`) REFERENCES `eshop_size` (`id`),
  CONSTRAINT `eshop_sku_ibfk_2` FOREIGN KEY (`color_id`) REFERENCES `eshop_color` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='最小销售单元/库存单位';

